import React from "react";
import { List, Card, Avatar, Row, Col, Typography, Progress } from "antd";
import "./App.css";
const { Meta } = Card;
const { Title } = Typography;

export default function technologies() {
  return (
    <div style={{ textAlign: "Center" }}>
      <Title level={3} style={{ color: "black", textAlign: "center" }}>
        Skills
      </Title>
      <Row
        align="middle"
        gutter={0}
        // type="flex"
        style={{ alignItems: "center", justifyContent: "center" }}
      >
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>Blockchain: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={3} lg={2} xl={2}>
          <Progress
            percent={90}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        {/* <Col xs={2} sm={2} md={9} lg={10} xl={10} /> */}
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>Ethereum: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={6} lg={4} xl={4}>
          <Progress
            percent={90}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        <Col xs={2} sm={2} md={18} lg={20} xl={20} />
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>React JS: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={6} lg={4} xl={4}>
          <Progress
            percent={90}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        <Col xs={2} sm={2} md={18} lg={20} xl={20} />
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>Next JS: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={6} lg={4} xl={4}>
          <Progress
            percent={80}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        <Col xs={2} sm={2} md={18} lg={20} xl={20} />
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>Node JS: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={6} lg={4} xl={4}>
          <Progress
            percent={80}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        <Col xs={2} sm={2} md={18} lg={20} xl={20} />
        <Col span={12}>
          <b>
            <p style={{ textAlign: "right", fontSize: "15px" }}>Others: </p>
          </b>
        </Col>
        <Col xs={10} sm={10} md={6} lg={4} xl={4}>
          <Progress
            percent={70}
            // successPercent={90}
            // size="small"
            format={percent => `${percent / 10}/10`}
            status="active"
          />
        </Col>
        <Col xs={2} sm={2} md={18} lg={20} xl={20} />
      </Row>
    </div>
  );
}
